import { CreateTheme } from '@mui/material'
import { palette } from '@mui/system'

export const Theme = CreateTheme({
         palette:{
                  primary: {
                           main: '#58D68D',
                           light: '#ABEBC6'
                  },
                  secondary:{
                           main: '#EC7063', 
                           light: '#F5B7B1'
                  },
                  otherColor:{
                           main: '#AF7AC5'
                  }
         }
})
